import albertoPicture from "../assets/alberto.png";
import { Ranking } from "../pages/Ranking";

export const UserRanked = ({ name, rating }) => {
  return (
    <div className="rounded-xl w-30 mb-3 mr-20 font-montserrat ml-20 bg-[#D9D9D9] shadow-md flex flex-row">
      <img src={albertoPicture} className="w-8 h-8 m-3"></img>
      <p className="m-4 tracking-wide">{name}</p>
      <div className="flex flex-rox-reverse">
        <p className="m-4">{rating}</p>
      </div>
    </div>
  );
};
